import "./App.css";
import React, { useState } from "react";
import Card from "./Components/Card";

function App() {
  let card = [
    {
      image: "https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885_1280.jpg",
      title: "Apple",
      price: "300$",
      desc: "This is the content of Card 1.",
      id: 1,
    },
    {
      image: "https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885_1280.jpg",
      title: "Samsung",
      price: "300$",
      desc: "This is the content of Card 14.",
      id: 2,
    },
    {
      image: "https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885_1280.jpg",
      title: "Tesla",
      price: "300$",
      desc: "This is the content of Card 13.",
      id: 3,
    },

    {
      image: "https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885_1280.jpg",
      title: "Amazon",
      price: "300$",
      desc: "This is the content of Card 12.",
      id: 4,
    },
    {
      image: "https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885_1280.jpg",
      title: "Google",
      price: "300$",
      desc: "This is the content of Card 2.",
      id: 5,
    },
    {
      image: "https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885_1280.jpg",
      title: "Google",
      price: "300$",
      desc: "This is the content of Card 2.",
      id: 6,
    },
  ];

  return (
    <div className="App">
      <div className="card-container">
        {card.map((item) => (
          <Card key={item.id} image={item.image} title={item.title} price={item.price} desc={item.desc} />
        ))}
      </div>
    </div>
  );
}

export default App;
